INSERT INTO `emails` VALUES (126,'2008-04-17 15:58:50','2008-04-17 16:00:24','Thursday',0,'Friday broomball is still going on.  Please respond if you ARE going to be there so we know if it\'s worth it.  If you aren\'t going to be there, no need to respond.',NULL,118,1,'days_before',NULL,0,NULL),(127,'2008-04-18 01:42:47','2008-04-18 01:42:47','Friday',NULL,'Patrick, just click on the yes link if you are going to play, otherwise we\'ll assume you aren\'t.',NULL,118,1,'now',NULL,0,NULL),(128,'2008-04-24 10:06:34','2008-04-24 10:06:34','Thursday',NULL,'Please let me know if you WILL be able to play tomorrow.  If we don\'t have enough, I\'ll send out another note to those that have responded with Yes or Maybe.',NULL,119,1,'now',NULL,0,NULL),(129,'2008-04-25 10:14:33','2008-04-25 10:14:33','Game On',NULL,'Game on. We have enough to play.',NULL,119,1,'now',NULL,0,NULL),(130,'2008-04-27 22:51:28','2008-04-28 00:17:16','DayBefore',1,'Please let me know if you can\'t make the game.  If the form doesn\'t work (Lotus Notes), just click on one of the links.\r\n\r\nAlso, check out www.myezteam.com/topics for a great re-cap of the early bird from swanee.',NULL,101,1,'days_before',NULL,0,NULL),(174,'2008-05-14 10:51:17','2008-06-30 04:00:16','1 Day Before',1,'Let me know if you\'ll be able to make the game.','2008-06-30 04:00:16',121,1,'days_before',NULL,0,NULL),(296,'2008-07-25 11:32:21','2008-07-25 11:32:21','MARTY: game on',NULL,'weather cleared up...Marty, meet us out there.',NULL,178,0,'now',NULL,0,NULL),(172,'2008-05-13 13:37:39','2008-08-04 04:00:18','1 Day Before',1,'Let me know if you\'ll be able to make the game.','2008-08-04 04:00:18',133,1,'days_before',NULL,0,NULL),(133,'2008-04-28 11:21:14','2008-04-28 11:21:14','Initial',1,'Please respond if you will be able to make it on Friday so we know if we will have enough to play.',NULL,134,1,'days_before',NULL,0,NULL),(134,'2008-05-02 09:57:27','2008-05-02 09:57:27','Help',NULL,'We\'ve only got 6 people for sure, quite a few