-11-16 12:50:45','2009-11-16 12:51:29',' - RSVP for this weeks game.',NULL,'We had 7 players for our first game of the year.  A decent showing but we\'ll need to do better than that!  End result:  Win 12-4  Our new goalie looked great and the rest of us looked OLD!\n\n I\'m sure we\'ll have a few folks missing this week (I will be out of town) so get your kitchen passes now.\n\n\nBeer Witch:  Scott Thorvilson','2009-11-16 12:51:29',543,1,'now',NULL,0,NULL),(1327,'2009-11-19 15:13:59','2009-11-19 15:14:10',' - SUBS NEEDED!',NULL,'We will be short players this week.  If you can make it, get your butts out there.\n\n','2009-11-19 15:14:10',543,1,'now',NULL,0,NULL),(1328,'2009-11-20 15:22:16','2009-11-23 04:00:22','Turkey Time: 11:30am',4,'Time to run off your holiday pounds.  Should have a good group of people after Thanskgiving.\n\nThere is a practice at 10:30, so we won\'t be able to get on the ice early like I was hoping, but we will get the ice longer than 1:30.','2009-11-23 04:00:22',489,1,'days_before',NULL,0,NULL),(1337,'2009-11-24 10:26:17','2009-12-04 04:00:07','Can you play?',2,'Please let me know ASAP if you can play this week.','2009-12-04 04:00:07',545,1,'days_before',NULL,0,NULL),(1338,'2009-11-24 10:26:17','2009-11-24 10:26:17','Status changed?',3,'Please let me know ASAP if your status has changed for this week.',NULL,545,1,'days_before',NULL,0,NULL),(1341,'2009-11-30 10:20:35','2009-11-30 10:20:50','Sloppy Waffles has registered.',NULL,'Let me know by responding \"Yes\" if you want to be a full-timer this year, or \"Maybe\" if you just want to be a sub','2009-11-30 10:20:50',546,1,'now',NULL,0,NULL),(1342,'2009-11-30 10:29:56','2009-11-30 10:30:34','RSVP for game',NULL,'Beer Bitch:  Anderson','2009-11-30 10:30:34',533,1,'now',NULL,0,NULL),(1343,'2009-12-02 10:53:44','2009-12-02 10:54:02','Bring $$ for Team Dues',NULL,'If you haven\'t already, bring your $120 for the team dues.  I need to have a check in Bob\'s hands by Dec 5th.  I have a number of people who have paid already, I\'d like to see the rest so I don\'t have to dig into the Wiedrich Twins piggy banks.','2009-12-02 10:54:02',533,0,'now',NULL,0,NULL),(1344,'2009-12-07 18:41:35','2009-12-07 18:42:04','Please RSVP for Game',NULL,'Beer Bitch:  Pete\n\nWe need to find a goalie, travis can\'t make it.','2009-12-07 18:42:04',534,1,'now',NULL,0,NULL),(1346,'2009-12-11 15:01:31','2009-12-11 15:01:44','Need Players',NULL,'Show up if you can...  low numbers this week.','2009-12-11 15:01:44',534,1,'now',NULL,0,NULL),(1347,'2009-12-16 00:20:21','2009-12-16 00:20:49','RSVP for game',NULL,'Beer:  Volunteer?\n\nI won\'t be able to make the game.  We could use a few more guys this week.','2009-12-16 00:20:49',535,1,'now',NULL,0,NULL),(1348,'2009-12-18 09:40:41','2009-12-18 09:41:29','Need Players',NULL,'We are going to be short this weekend.  I\'m out this week due to my surgery, but will be back after the new year.\n\nGet your kitchen passes or call friends who can play.  We only have 5 \"yes\" rsvp\'s.','2009-12-18 09:41:29',535,1,'now',NULL,0,NULL),(1350,'2009-12-28 08:55:54','2010-01-04 04:00:06','Can you play?',1,'Please let me know if you will be at the game or not.','2010-01-04 04:00:06',548,1,'days_before',NULL,0,NULL),(1351,'2009-12-28 08:55:54','2009-12-28 08:55:54','Please respond',0,'Please let me know ASAP if you can play tonight.',NULL,548,1,'days_before',NULL,0,NULL),(1352,'2009-12-28 08:55:54','2010-01-11 04:00:25','Can you play?',1,'Please let me know if you will be at the game or not.','2010-01-11 04:00:25',549,1,'days_before',NULL,0,NULL),(1353,'2009-12-28 08:55:54','2009-12-28 08:55:54','Please respond',0,'Please let me know ASAP if you can play tonight.',NULL,549,1,'days_before',NULL,0,NULL),(1354,'2009-12-28 08:55:54','2010-01-18 04:00:57','Can you play?',1,'Please let me know if you will be at the game or not.','2010-01-18 04:00:57',550,1,'days_before',NULL,0,NULL),(1355,'2009-12-28 08:55:54','2010-01-19 04:00:36','Please respond',0,'Please let me