INSERT INTO `posts` VALUES (1,'2008-03-31 21:29:17','2008-03-31 21:29:17',1,3,'Like everyone else said, it was a tough end to the season, but I think we are going to have a great \'09. Looking forward to the summer Barons golf events.',NULL),(2,'2008-03-31 22:13:40','2008-03-31 22:13:40',2,3,'I have added message board functionality, so you can now smalk talk with all the players on your teams. Check out the Msg Board tab above.  I will be creating a post where you can posts your comments so I can improve the site.',NULL),(3,'2008-03-31 22:18:43','2008-03-31 22:18:43',3,3,'Please use this topic if you have any comments/suggestions on how I can improve the site.  I have many more functions I want to implement, just have to find the time.  I will list some of the functions I plan to add in this topic.',NULL),(4,'2008-03-31 22:19:57','2008-03-31 22:19:57',4,3,'Please use this topic if you run into problems.  I am often updating the site piece-by-piece and sometimes miss something.  If you run into any problems, please let me know by posting in here.  Thanks.',NULL),(5,'2008-03-31 22:35:41','2008-03-31 22:35:41',4,3,'If you are using Internet Explorer, you might see duplication of events, topics, etc....  I\'m working on fixing this.',NULL),(6,'2008-03-31 22:44:45','2008-03-31 22:44:45',3,3,'I plan to add the ability to integrate each team with a google calendar so that events that get created here will show up there and <b>hopefully</b> the other way around as well.',NULL),(7,'2008-03-31 23:24:09','2008-03-31 23:24:09',1,138,'Nationals is over-rated anyway.  We had some fun in Fargo and the bus was awesome.  Let\'s make \'09 the year of the Barons.',NULL),(8,'2008-04-01 12:31:53','2008-04-01 12:31:53',1,132,'We got ranked 10th....Schwartz will be happy that we are no longer over rated. I dont think checking is our problem...maybe for a few guys but if that is the case then we just shorten our bench for those tourneys. Outside of that we need to get better in the transition game near the blue line. We have to stop turning the ball over when we have the advantage. Rather than flashy little passes we need to control the ball into the zone and set things up. We need to work on setting up one timers and actually putting the shots on net. Then we need to have our goalie pull his head out of his ass and start putting up shutouts like he was brought in to do. I really enjoy playing with every one of you knuckleheads...except for Sherm. He stinks on ice..Sherm, you are the only guy I know that eating taco bell would be an improvement. Moving on, I will be working on my game all summer so that next year we will be an unstopable force.',NULL),(9,'2008-04-01 13:48:40','2008-04-01 13:48:40',1,136,'Wow! A drop from 4th to 10th. The mag is trying to fire us up with that bump. It certainly got me riled up. Corless, I was potent this weekend, but you couldn\'t smell me from the net. Now that I stopped drinking Mich Golden Light the smoke has cleared. That\'s it! Light beer is not my friend.',NULL),(10,'2008-04-01 13:49:48','2008-04-01 13:49:48',4,136,'Junkin--this site is painfully slow.',NULL),(11,'2008-04-01 14:00:44','2008-04-01 14:00:44',4,3,'I know -- I\'m currently leasing some VPS space from another site, not sure how many others are on the same site as well -- I hope to move soon.',NULL),(12,'2008-04-01 20:32:41','2008-04-01 20:32:41',3,139,'Great Idea setting this Message board up Junker , another Message board that works pretty easy is   http://www.boardhost.com/free/  the Stinky Can page has been on it for years . good stuff GO BARONS 09',NULL),(13,'2008-04-01 22:15:09','2008-04-01 22:15:09',1,144,'Fuck Sluggo',NULL),(14,'2008-04-02 08:56:31','2008-04-02 08:56:31',1,3,'<i>Josh Boeddeker</i>: <b>Fuck Sluggo</b>\r\nhaha, there ya go',NULL),(15,'2008-04-02 11:26:25','2008-04-02 11:26:25',4,3,'<i>Pat Sherman</i>: <b>Junkin--this site is painfully slow.</b>\r\nI implemented some caching last night, but had some problems when trying to upload the changes.  I will try again tonight.  You should see improved performance.',NULL),(16,'2008-04-02 12:05:04','2008-04-02 12:05:04',5,3,'Ira was the #1 overall pick, can you believe that?\n\nAnd Mad Dog, you have 1 decent weekend and Corless thinks you\'re God.',NULL),(17,'2008-04-02 13:03:47','2008-04-02 13:03:47',5,138,'Corless recognizes true talent when he sees it.',NULL),(18,'2008-04-02 13:08:25','2008-04-02 13:08:25',4,138,'Some puctuation does some weird things in the compose field on the message board.  Specifically the apostrophe and exclamation point.',NULL),(21,'2008-04-02 13:55:13','2008-04-02 13:55:13',4,3,'<i>Mike Madetzke</i>: <b>Some puctuation does some weird things in the compose field on the message board.  Specifically the apostrophe and exclamation point.</b>\r\n\r\nReally!!  I haven\'t seen an anything like that.',NULL),(23,'2008-04-02 14:03:21','2008-04-02 14:03:21',4,3,'<i>Mike Madetzke</i>: <b>Some puctuation does some weird things in the compose field on the message board.  Specifically the apostrophe and exclamation point.</b>\r\nAh -- you must be using IE.  It\'s trying to move \"panes\" on you, I\'ll see if I can fix that, but you should really be using Firefox ;)\r\n',NULL),(24,'2008-04-02 17:32:39','2008-04-02 17:32:39',4,3,'<i>Pat Sherman</i>: <b>Junkin--this site is painfully slow.</b>\r\nOk, I got some cache\'ing working now, so that should speed things up a bit, but I will continue to work on it.','129.42.161.36'),(25,'2008-04-02 17:33:36','2008-04-02 17:33:36',4,3,'<i>Jeremy McJunkin</i>: <b>If you are using Internet Explorer, you might see duplication of events, topics, etc....  I\'m working on fixing this.</b>\r\nThis issue should be fixed now, please let me know if you are still seeing this behavior.\r\n','129.42.161.36'),(26,'2008-04-02 17:36:48','2008-04-02 17:36:48',7,3,'When will we have our new shirts for the Whiskey Drug team?','129.42.161.36'),(27,'2008-04-02 18:46:57','2008-04-02 18:46:57',1,130,'Ya we are no longer over rated that is for sure.','172.24.96.144'),(28,'2008-04-02 20:53:02','2008-04-02 20:53:02',8,131,'Is there any way for a mean bastard with a sweet \'stache to post a photo of himself on his player page?  Some of the ladies from Fargo will want a place to get their fill of that mug!','168.97.133.236'),(29,'2008-04-02 20:55:55','2008-04-02 20:55:55',1,131,'Ratings, shmratings.  Who cares what Dave thinks of our team?  We just need to focus on the things we need to improve and start kicking ass next fall.\r\n\r\nP.S.  I agree with nearly all of what Corless says...especially the part about the goalie.','168.97.133.236'),(30,'2008-04-02 20:58:00','2008-04-02 20:58:00',4,131,'I am still seeing the strange issue that was noted by one, Mike Madetzke, regarding punctuation causing erratic behavior.  For me it is the apostrophe and the exclamation mark also.','168.97.133.236'),(31,'2008-04-03 09:42:13','2008-04-03 09:42:13',4,3,'<i>George (Eric) Bausman</i>: <b>I am still seeing the strange issue that was noted by one, Mike Madetzke, regarding punctuation causing erratic behavior.  For me it is the apostrophe and the exclamation mark also.</b>\r\nYeah, I haven\'t tried to fix that yet.  If you use Firefox, you shouldn\'t see that issue.','24.159.203.27'),(32,'2008-04-03 09:43:00','2008-04-03 09:43:00',8,3,'That\'s on my list of things to do -- can\'t wait to see that pic up here.','24.159.203.27'),(33,'2008-04-03 10:52:14','2008-04-03 10:52:14',5,132,'<i>Mike Madetzke</i>: <b>Corless recognizes true talent when he sees it.</b>\r\n','69.130.223.234'),(34,'2008-04-03 10:59:23','2008-04-03 10:59:23',5,132,'Junk why did you bail? you totally screwed up my draft list you bastard....you have to tell me before hand next time....but my team is tight yall. Josh was going to be my secret weapon but somebody swooped him up. Now being the #1 pick will go straight to Iras head...to bad my team is going to kick six different kinds of dog crap out of his team. mad Dog time to represent brotha  WHY CAN I NOT PUNCTUATE??? oh i see the ? works what about the other fun stuff? exclamation point, apostrophe the usual stuff...Junker sucks at the interweb.','69.130.223.234'),(35,'2008-04-03 11:21:42','2008-04-03 11:21:42',5,3,'Damn nephews birthday party on the Iron Man that my wife decides to tell me about on Monday.\r\n\r\nI don\'t suck at the intrawebs, y\'all suck at using the intrawebs.  Internet Explorer should be banned!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!','129.42.161.36'),(36,'2008-04-03 11:47:38','2008-04-03 11:47:38',4,138,'I use firefox at home, but my work refuses to implement it.  But I think I have a workaround.  From now on I will just insert the word apostrophe whenever I need it.  Ditto with exclamation pointexclamationpoint','69.11.133.2'),(37,'2008-04-03 12:23:15','2008-04-03 12:23:15',4,3,'Haha -- that\'s great!!!!','129.42.161.36'),(38,'2008-04-03 14:43:22','2008-04-03 14:43:22',9,132,'Thanks to Al Gore we have this wonderful technology and then Junker comes along and screws it all up. Internet Explorer is like Kleenex. Sure you might be using Scott or Viva but you still call it Kleenex.','69.130.223.234'),(39,'2008-04-03 19:53:20','2008-04-03 19:53:20',8,136,'George. A stache that good needs to be shared with the world. I hope you didn\'t shave it off. \r\n','160.94.79.46'),(40,'2008-04-03 19:53:51','2008-04-03 19:53:51',4,138,'&#33; - Just checking if the ascii html works.','69.11.133.2'),(41,'2008-04-03 19:55:15','2008-04-03 19:55:15',1,136,'How bloated do you think Dave\'s face was after that shot from kurt swelled up?\r\n\r\n<i>George (Eric) Bausman</i>: <b>Ratings, shmratings.  Who cares what Dave thinks of our team?  We just need to focus on the things we need to improve and start kicking ass next fall.\r\n\r\n\r\n\r\nP.S.  I agree with nearly all of what Corless says...especially the part about the goalie.</b>\r\n','160.94.79.46'),(42,'2008-04-03 19:57:28','2008-04-03 19:57:28',4,138,'<i>Mike Madetzke</i>: <b>! - Just checking if the ascii html works.</b>\r\n\r\nOkay, I am a big nerd, but you can insert the ascii html code for the exclamation point in explorer and it converts it to a &#33;\r\n','69.11.133.2'),(43,'2008-04-03 21:52:02','2008-04-03 21:52:02',4,3,'Yeah, you can insert any HTML code to get converted, which reminds that even scripts will get run, so I better make sure I am sanitizing it.','24.159.203.27'),(44,'2008-04-03 23:33:24','2008-04-03 23:33:24',8,131,'Sorry dude.  It is gone.  My brother and sister-in-law said it was so bad it looked good.  I guess I ought to think about bringing it back?','71.210.156.40'),(111,'2008-08-18 21:52:03','2008-08-18 21:52:03',33,105,'I just found out that the \"Balls Deep\" team is from my wife\'s (Mindy) lab at Mayo.  Right now they are overlooking us with the theory that we are all computer nerds.  Lets kick their balls deep and start off the season undefeated at 6:15 Monday the 25th.  ','24.159.207.7'),(46,'2008-04-04 10:19:13','2008-04-04 10:19:13',1,132,'I can still hear the sound of the ball hitting his face. ','69.130.223.234'),(47,'2008-04-04 12:36:33','2008-04-04 12:36:33',11,131,'A photo of the kid is on the USA Broomball web-site banner.  Maybe that\'s the payback for being ranked 10th?','168.97.133.236'),(48,'2008-04-04 13:21:02','2008-04-04 13:21:02',11,138,'Yeah, but they took Blommel down.  He used to be the Baron jersey up there.','69.11.133.2'),(49,'2008-04-04 14:52:38','2008-04-04 14:52:38',11,131,'Good point.  I guess as long as we net zero, we are OK.','168.97.133.236'),(50,'2008-04-04 15:15:18','2008-04-04 15:15:18',11,3,'You know how much it cost me to have Dave put that up there.  $300.50  Add it to the Baron\'s bill.','24.159.203.27'),(51,'2008-04-05 13:57:03','2008-04-05 13:57:03',12,131,'Guys...I have not done all of the math for each individual player, but my spreadsheet shows that at the end of the day the team owes me $350 for the second half of the season.  (Remember, everyone except Braun paid me $85 in December.)  So, I say everyone can pay me $20 more (at 17 guys that equals $340 and I do not mind eating the extra $10) at your convenience.  You can just pay me the next time you see me at another Baron event.  Or, if you want to send a check, you can send it to 294 Dayton Ave, #1E, St. Paul, MN 55102.\r\n\r\nBraun, I will deal with you separately.\r\n\r\nLet me know of any questions.\r\n\r\nGeorge\r\n651-325-7643','168.97.133.236'),(52,'2008-04-05 14:13:25','2008-04-05 14:13:25',13,131,'Fellas,\r\n\r\nThe deadline to register for the World Tourney is April 30th.  \r\n\r\nI know we have been assuming that everyone is IN, and that the Barons are going to kick ass.  It has been taken for granted.\r\n\r\nBut, NOW is the time to be SERIOUS & HONEST about whether or not you/we can go!\r\n\r\nI do not want to send in $1250 now, then find out in September that a bunch of guys cannot make it.  Believe me, there might be some disappointment now if you say you cannot go, BUT it will be MUCH MORE disappointing to find that out a month before the tournament.\r\n\r\nBesides, if we know now who is in and who is out, we might be able to figure out our options, like combining with another Minnesota team that does not have a full roster for the tourney.\r\n\r\nAnyway, a little bit of pressure on everyone, but let us get this figured out.\r\n\r\nGeorge','168.97.133.236'),(53,'2008-04-05 14:14:44','2008-04-05 14:14:44',12,3,'Check will be sent on Monday.  Thanks for handling the finances.\r\n<i>\r\nConfirmation Number:		52\r\nAmount:		$25.00\r\nNickname:		George\r\nPayable To:		Eric Bausmen\r\nAddress:		294 Dayton Ave\r\n#1E\r\nSt. Paul, MN 55102\r\nMemo/Account Number:		2nd half Barons finances\r\nTo Be Mailed On: 		04/07/2008\r\nDelivery Type:		First-class mail\r\n</i>','24.159.203.27'),(54,'2008-04-05 14:17:18','2008-04-05 14:17:18',13,3,'I really hope that I can go, but I honestly won\'t know until it gets closer to November.  The wife has been really against all this broomball stuff, but I\'ll try to work my magic for the next few months.  Right now put me at 50/50.  I know that doesn\'t really help you figure out numbers.','24.159.203.27'),(55,'2008-04-07 11:27:18','2008-04-07 11:27:18',13,132,'IN','69.130.223.234'),(56,'2008-04-07 12:23:22','2008-04-07 12:23:22',13,138,'I am in.  In fact, I plan to get there a little early to scope out the city.  ','69.11.133.2'),(57,'2008-04-07 23:24:30','2008-04-07 23:24:30',13,136,'Count me out for now. I won\'t know for sure until September.\r\n','75.168.216.151'),(58,'2008-04-07 23:28:01','2008-04-07 23:28:01',12,136,'George, are you planning to do something drastic to Braun...like snuff him out? Let me know if need a hand. I can pour the cement shoes.\r\n\r\n<i>George (Eric) Bausman</i>: <b>Guys...I have not done all of the math for each individual player, but my spreadsheet shows that at the end of the day the team owes me $350 for the second half of the season.  (Remember, everyone except Braun paid me $85 in December.)  So, I say everyone can pay me $20 more (at 17 guys that equals $340 and I do not mind eating the extra $10) at your convenience.  You can just pay me the next time you see me at another Baron event.  Or, if you want to send a check, you can send it to 294 Dayton Ave, #1E, St. Paul, MN 55102.\r\n\r\n\r\n\r\nBraun, I will deal with you separately.\r\n\r\n\r\n\r\nLet me know of any questions.\r\n\r\n\r\n\r\nGeorge\r\n\r\n651-325-7643</b>\r\n','75.168.216.151'),(59,'2008-04-08 10:54:57','2008-04-08 10:54:57',14,3,'It better start warming up soon, otherwise it\'s going to be rather chilly at the early bird.','129.42.161.36'),(60,'2008-04-08 11:32:10','2008-04-08 11:32:10',14,115,'Johnny will have stiff nipples again.  I think he likes that.','12.64.12.241'),(61,'2008-04-08 15:34:03','2008-04-08 15:34:03',15,3,'Ira -- when are we going to scrimmage? I want to get that nasty taste of Nationals out of my mouth.','129.42.161.36'),(62,'2008-04-08 21:50:11','2008-04-08 21:50:11',15,139,'Junker you are in the Stinky Trash Can Tourney Marko just dropped out ','66.41.72.231'),(63,'2008-04-08 22:31:00','2008-04-08 22:31:00',15,3,'Sweet.  Any other Barons playing?','24.159.203.27'),(64,'2008-04-08 23:59:11','2008-04-08 23:59:11',15,139,'Coreless,Ira Mad dog,Schwartz,Braun and Blommel and maybe Josh if he gets in \r\n<i>Jeremy McJunkin</i>: <b>Sweet. Any other Barons playing?</b>\r\n','66.41.72.231'),(65,'2008-04-09 00:00:05','2008-04-09 00:00:05',15,139,'and Ryan and I are captains \r\n\r\n<i>Jeremy McJunkin</i>: <b>Sweet. Any other Barons playing?</b>\r\n','66.41.72.231'),(66,'2008-04-09 15:27:58','2008-04-09 15:27:58',14,5,'Do we know if Pro plans on playing? I assume so since he was asking who was in for the tournament.','129.42.161.36'),(67,'2008-04-11 10:43:08','2008-04-11 10:43:08',15,132,'Scotty is the Stinky Can Master.\r\nI am ready to scrimmage at any time...Ira get to work on that.','69.130.223.234'),(68,'2008-04-11 10:54:49','2008-04-11 10:54:49',15,138,'Where are the Barons for Ironman?  Gotta represent.  Team Corless is going to mop the floor with those other suckers.','69.11.133.2'),(69,'2008-04-12 10:16:49','2008-04-12 10:16:49',16,3,'I think if the T-Wolves win 1 more game, Ira will win all of his bets, if that happens, I think he should buys a few kegs and invite us over.','24.159.203.27'),(70,'2008-04-13 15:44:15','2008-04-13 15:44:15',14,115,'Yep. The Old Pro is playing.','64.61.220.30'),(71,'2008-04-13 17:31:23','2008-04-13 17:31:23',14,3,'Wow, if Pro\'s playing, that must mean Larcat will be at first.  Going to  be a scramble for right and catcher.','24.159.203.27'),(72,'2008-04-13 17:47:29','2008-04-13 17:47:29',17,3,'So what happened in the Iron Man?  I hear Ira lost in the finals to Dave.  I guess we found out what happens when an immovable object meets an unstoppable force.','24.159.203.27'),(73,'2008-04-14 11:36:20','2008-04-14 11:36:20',18,3,'Me, Scotty and Schwartz are going to dominate all','129.42.161.36'),(74,'2008-04-14 13:02:30','2008-04-14 13:02:30',16,138,'I discussed this very topic with Ira at the Ironman.  With the wins he has so far, he has already agreed to host a party.  With one more win, I think he should get some adult entertainment at the party he is already going to throw...','69.11.133.2'),(75,'2008-04-14 16:13:05','2008-04-14 16:13:05',16,132,'I completely agree both assessments. Ira, I like summit and what kind of appetizers may we be expecting?','69.130.223.234'),(76,'2008-04-14 16:17:48','2008-04-14 16:17:48',18,132,'AHAHAHA that is the worst lineup ever. I hope someone else on your team knows how to score a goal because you three meatballs sure dont. Good luck in the dumpster game. It will be sad to see scotty lose his captaincy.','69.130.223.234'),(77,'2008-04-15 18:13:30','2008-04-15 18:13:30',14,115,'First league game is 4/29  at  7:15  against Med-City Collision.\r\nThere are 8 teams in the 2008 Mens American Softball League.\r\n12 games  no byes   6:15  3    7:15  2     8:15  3     9:15  4\r\n\r\nNo games the week of July 4th.\r\nAll games on field #5','129.42.161.36'),(78,'2008-04-15 18:21:47','2008-04-15 18:21:47',4,115,'Hey, I changed an event time, but the right hand column that includes a summary of Upcoming Events still shows the old time.  I signed out and back in to see if it would get updated. It did not.','129.42.161.36'),(79,'2008-04-16 10:59:33','2008-04-16 10:59:33',19,107,'Are we planning on getting together to hit some balls anytime soon??','71.32.135.137'),(80,'2008-04-16 11:05:29','2008-04-16 11:05:29',16,128,'YO, I\'ve got to get to this board more often. The party is on (the Wolves came through - just barely!). We will have to figure out a time that works for most. Iron Man was a blast - we protected our goalie who had never played indoor or with that ball and he came through. Should have won (sound familiar?), we carried play in the finals but lost to a late goal after we had plenty of chances (again, familiar?).   The adult entertainment for the