a stunning .765 (13-17)!\r\nBulau had a 3 HR, 7 RBI game.\r\nJunker and Swanee also had OBPs over .600.\r\nBish brought a new team bat.\r\nJunker and Johnny both had 4-4 games, went yard, and got the first two hits with the new stick.\r\nBurman started out 5-5 with a HR in his two games played.\r\nCarrot started the summer with the first pre-game beer.\r\nLarry got hit in the head zero times.\r\nBrowntounge the liar never made an out.\r\nSuperfan was pleasant and may have avoided sunburn (final results not in).\r\nMikayla (sp?) Cradick made her first appearance at an Eagle Drug/WBR game and Ryan brought beer!\r\n\r\n\r\nPro is out for league game 1.  We need the other 10 regulars to play Tuesday at 7:15.  Thats 7:15pm, Jen.  :)  Use Junker\'s website to RSVP attendance.  http://www.myezteam.com/users/login   Bish is Beerman, or should I say K-man #1?\r\n\r\n-jks','64.61.221.21'),(87,'2008-04-30 10:46:21','2008-04-30 10:46:21',21,115,'Game 1 wasn\'t pretty, but we got it done with 2 outs in the bottom of the 7th, stringing together 3 big hits for the two winning runs.  14-13.','129.42.161.36'),(88,'2008-05-02 11:23:29','2008-05-02 11:23:29',21,107,'you gave Vav a hit?','71.32.135.137'),(89,'2008-05-02 11:52:53','2008-05-02 11:52:53',21,3,'I can\'t believe that was marked a hit.  I guess vavra is admitting he couldn\'t make that play.','129.42.161.36'),(90,'2008-05-05 16:25:30','2008-05-05 16:25:30',22,115,'Kyle K is subbing for Pro, if his prego wife doesn\'t pop.\nI am BEERMAN!  Boo-yaahh.  You won\'t catch me whining like a Bish about it.  It is the best day of the year.','129.42.161.36'),(91,'2008-05-07 15:48:38','2008-05-07 15:48:38',22,115,'Frikken rain....','129.42.161.36'),(92,'2008-05-07 16:39:38','2008-05-07 16:39:38',22,115,'BTW, I drank all the beer while watching the Twins get 1 hit.  You f\'ers missed out.','129.42.161.36'),(93,'2008-05-07 16:57:12','2008-05-07 16:57:12',22,3,'You should\'ve come over and watched some MMA...Would\'ve been more exciting than watching the Twins game.','129.42.161.36'),(94,'2008-05-12 14:14:30','2008-05-12 14:14:30',23,115,'Kyle Kroening is planning to sub 5/13. No baby yet.\n\nGood chance of rain again. :(  ','129.42.161.36'),(95,'2008-05-13 13:58:48','2008-05-13 13:58:48',23,3,'It\'s looking like the rain is going to hold off.  Going to be pretty chilly though.','129.42.161.36'),(96,'2008-05-18 12:09:01','2008-05-18 12:09:01',24,131,'Well fellas, it\'s official.  The St. Paul Barons have registered for the 2008 World Broomball Championships in Burnaby (Vancouver), British Columbia, Canada - November 3-9, 2008.\r\n\r\nI know that some of you cannot make it, some of you may be able to make it, some of you won\'t know until October, and some of you are 100% stone-cold locks to make it.\r\n\r\nIra, Jay Schwartz, Corless, and George had a meeting last Monday, and determined that whatever the number of \'real\' Barons that can make it (and, right now it looks to be ~8-10), there are likely to be a number of very talented Minnesota players - whose teams are NOT registered - interested in going with us.\r\n\r\nSo, the decision was made.  We\'re IN.\r\n\r\nThe registration fee is $1250 CAD (at today\'s exchange rate, that\'s ~ $1280 USD).  It has been paid (by me - on my credit card) and is non-refundable.\r\n\r\nCurrently, we\'re holding 5 rooms (all under my name) at the Holiday Inn Express - Metrotown.  Room rates are $119 CAD per night (at today\'s exchange rate, that\'s ~ $120 USD).\r\n\r\nSo...now it\'s time to start fundraising!  As you know, we are planning our Barons Broomball Golf Tourney fundraiser at Theo Wirth Park.  Ira is confirming the dates, but it\'s looking like June 28th is the best for most of us.  Save that date.  We definitely want to get as many people as possible so we can cover the World\'s registration fee AND our hotel accommodations (if possible).\r\n\r\nLet me know of any questions!  Let\'s start getting mentally prepared for November - today!\r\n\r\nGeorge','16